import random
import math
import numpy

def fitness_function(problem, generation):
    graph = problem

    fitnesses = []
    for gene in generation:
        fitness = 0
        for j in range(len(gene)):
            if j == len(gene) - 1:
                fitness += graph[gene[j]][gene[0]]
            else:
                fitness += graph[gene[j]][gene[j+1]]
        fitnesses.append(fitness)
    return fitnesses

def tournament_selection(fitnesses, tournament_size):
    parent_indices = set()
    while len(parent_indices) < 2:
        tournament = []
        for _ in range(tournament_size):
            tournament.append(math.floor(random.uniform(0, len(fitnesses))))
        
        min_fitness = float("inf")
        for participant in tournament:
            if min_fitness > fitnesses[participant]:
                parent_index = participant
                min_fitness = fitnesses[participant]

        parent_indices.add(parent_index)
    
    return list(parent_indices)

def create_edge_table(parent_1, parent_2):
    edge_table = [set() for i in range(len(parent_1))]
    for i in range(len(parent_1)):
        if i == len(parent_1) - 1:
            edge_table[parent_1[i]].add((parent_1[0], False))
            edge_table[parent_1[0]].add((parent_1[i], False))
        else:
            edge_table[parent_1[i]].add((parent_1[i + 1], False))
            edge_table[parent_1[i + 1]].add((parent_1[i], False))
    for i in range(len(parent_2)):
        if i == len(parent_2) - 1:
            if (parent_2[0], False) in edge_table[parent_2[i]]:
                edge_table[parent_2[i]].remove((parent_2[0], False))
                edge_table[parent_2[i]].add((parent_2[0], True))
                edge_table[parent_2[0]].remove((parent_2[i], False))
                edge_table[parent_2[0]].add((parent_2[i], True))
            else:
                edge_table[parent_2[i]].add((parent_2[0], False))
                edge_table[parent_2[0]].add((parent_2[i], False))
        else:
            if (parent_2[i + 1], False) in edge_table[parent_2[i]]:
                edge_table[parent_2[i]].remove((parent_2[i + 1], False))
                edge_table[parent_2[i]].add((parent_2[i + 1], True))
                edge_table[parent_2[i + 1]].remove((parent_2[i], False))
                edge_table[parent_2[i + 1]].add((parent_2[i], True))
            else:
                edge_table[parent_2[i]].add((parent_2[i + 1], False))
                edge_table[parent_2[i + 1]].add((parent_2[i], False))
    return edge_table
 
def edge_recombination_crossover(parent_1, parent_2):
    edge_table = create_edge_table(parent_1, parent_2)

    current = math.floor(random.uniform(0, len(parent_1)))
    child = [current]
    while len(child) < len(parent_1):
        edges = edge_table[current]

        # calculate common_edge_list and smallest_edge_list
        common_edge_list = []
        smallest_edge_list_size = float("inf")
        smallest_edge_list = []
        for edge in edges:
            if edge[1]:
                common_edge_list.append(edge[0])
            else:
                edge_list = edge_table[edge[0]]
                if len(edge_list) < smallest_edge_list_size:
                    smallest_edge_list_size = len(edge_list)
                    smallest_edge_list = [edge[0]]
                elif len(edge_list) == smallest_edge_list_size:
                    smallest_edge_list.append(edge[0])
        
        # pick based on common_edge_list, smallest_edge_list, or last vertex
        if len(common_edge_list) != 0:
            next = common_edge_list[math.floor(random.uniform(0, len(common_edge_list)))]
        elif len(smallest_edge_list) != 0:
            next = smallest_edge_list[math.floor(random.uniform(0, len(smallest_edge_list)))]
        else:
            for i in range(len(edge_table)):
                if edge_table[i] != None and i != current:
                    next = i
                    break

        # remove current edge from edge_table
        for edge in edges:
            edge_table[edge[0]].remove((current, edge[1]))
        edge_table[current] = None

        current = next
        child.append(current)
    return child

def simple_inversion(gene, i, j):
    new_gene = list(gene[0:i])
    new_gene.extend(list(gene[j:i:-1]))
    new_gene.append(gene[i])
    new_gene.extend(list(gene[j + 1:]))
    return new_gene

def simple_inversion_mutation(gene, p_m):
    if random.uniform(0, 1) < p_m:
        n = len(gene)
        i = math.floor(random.uniform(1, n))
        if i == 1:
            j = math.floor(random.uniform(i + 1, n - 1))
        else:
            j = math.floor(random.uniform(i + 1, n))

        new_gene = simple_inversion(gene, i, j)
        return new_gene
    else:
        return gene

def generate_initial_generation(popsize, genesize):
    initial_generation = []
    for _ in range(popsize):
        gene = list(numpy.random.permutation(genesize))
        initial_generation.append(gene)
    return initial_generation

def determine_n_best(list, n):
    local_list = list.copy()

    indices = []
    for _ in range(n):
        min_element = float("inf")
        for i in range(len(local_list)):
            if local_list[i] < min_element:
                index = i
                min_element = local_list[i]
        local_list[index] = float("inf")
        indices.append(index)
    return indices

def generational_ga(problem):
    graph = problem

    parameters = {
        "popsize": 1000,
        "maxgen": 200,
        "fitness_function": fitness_function,
        "elitism": 5,
        "parent_selection": tournament_selection,
        "tournament_size": 5,
        "recombination_operator": edge_recombination_crossover,
        "mutation_operator": simple_inversion_mutation,
        "p_m": 0.10,
    }

    current_generation = generate_initial_generation(parameters["popsize"], len(graph))
    for n in range(parameters["maxgen"]):
        fitnesses = parameters["fitness_function"](problem, current_generation)

        next_generation = []
        elites = determine_n_best(fitnesses, parameters["elitism"])
        for elite in elites:
            next_generation.append(current_generation[elite])

        while len(next_generation) < len(current_generation):
            [parent_1_index, parent_2_index] = parameters["parent_selection"](fitnesses, parameters["tournament_size"]) 
            child = parameters["recombination_operator"](current_generation[parent_1_index], current_generation[parent_2_index])
            child = parameters["mutation_operator"](child, parameters["p_m"])
            next_generation.extend([child])
        current_generation = next_generation
        
    fitnesses = parameters["fitness_function"](problem, current_generation)

    return min(fitnesses)
    
            
